import React from 'react';
import SqlHeroLogo from '../../assets/images/SQL Hero Logo.png';
import { useNavigate } from 'react-router-dom';

function LandingNav() {
    const navigate = useNavigate();

    const handleLoginClick = () => {
        navigate('/login'); // Navigate to the login route
    };
    
    return (
        <nav className='px-52 py-3 flex justify-between items-center border-b'>
            <img src={SqlHeroLogo} alt='' className='h-12' />
            <button onClick={handleLoginClick} className='custom-btn'>Start Playing</button>
        </nav>
    );
}

export default LandingNav;
